import React from "react"
import { Container } from "react-bootstrap"
import "./login.css"

export default function CenteredContainer({ children }) {
  return (
    <Container
      className="d-flex justify-content-end containerLogin"
      style={{ minWidth: "100vw" }}
    >
      <div className="w-100" style={{ maxWidth: "400px",   opacity: "0.9,", marginTop: "10%"}}>
        {children}
      </div>
    </Container>
  )
}
